pub(super) const MAX_ABS_EXP: u32 = 512;

#[inline(always)]
pub(super) fn get_power_of_five(n: i32) -> (u128, u128, u128, i32) {
    debug_assert!(n.unsigned_abs() <= MAX_ABS_EXP);
    POWERS_OF_FIVE[(n + MAX_ABS_EXP as i32) as usize]
}

